import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">

      {/* Main navbar */}
      <nav className="navbar h-navbar fixed-top bg-info main-hd">
      </nav>


      {/* Main container */}
      <div className="container-fluid">


        <div className="row">
          <div className="col-3 bg-danger">

            <div className="card position-fixed card-row">
              <img src="avatar.png" className="card-img-top" alt="..."/>
              <div class="card-body">
                <h5 class="card-title">Profile Name</h5>
                <p class="card-text">Description Profile</p>
                <a href="#" class="btn btn-primary">Ver perfil</a>
              </div>

            </div>

          </div>  
        </div>

      </div>




    </div>
  );
}

export default App;
